Get-ADUser -Filter '(ObjectCategory -eq "user") -And (ObjectClass -eq "Person") -And (GivenName -like "*") -And (sn -like "*") -And (mail -like "*@gsa.gov")' -Properties SamAccountName, GivenName, sn, mail, OfficePhone, Division, Title, employeeType, Enabled | select SamAccountName, GivenName, sn, mail, OfficePhone, Division, Title, employeeType, Enabled | Export-Csv -Path 'GSA_Pocs.csv' -NoTypeInformation